export const START_BOARD_ITERATE = 'START_BOARD_ITERATE';
export const BOARD_ITERATE_SUCCESS = 'BOARD_ITERATE_SUCCESS';
export const TOGGLE_CELL_UPDATE = 'TOGGLE_CELL_UPDATE';
//export const BOARD_INIT_FAILURE = 'BOARD_INIT_FAILURE';

export const iterateBoard = board => dispatch => {
  console.log('start iterate');
  dispatch({ type: START_BOARD_ITERATE });
  /*
    Rules:

  */

  console.log('iterate success');
  dispatch({ type: BOARD_ITERATE_SUCCESS, payload: board });
}

export const toggleCellState = id => dispatch => {
  dispatch({ type: TOGGLE_CELL_UPDATE, payload: id  });
}
